resources.afterResponseScript:
insomnia.test("Extrair Token de Acesso", function () {
  const responseJson = insomnia.response.json();
  const token = responseJson.token;

  insomnia.environment.set("ACCESS_TOKEN", token);

  console.log("Token de acesso: " + token);
});

